import React from'react';
import yelplogo from '../img/yelp.png'; // with import
import weatherlogo from '../img/weather.png'; // with import


const Footer = () =>(

    <div className="footer">
            <ul>
                <li><p>Made With: </p></li>
                <li><img src={yelplogo} alt="gyelp logo" height="30" width="40"></img></li>
                <li><img src={weatherlogo} alt="weather api logo" height="20" width="20"></img></li>
            </ul>
    </div>

);



export default Footer;
